import React, { useEffect } from 'react';
import { withStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import Dialog from '@material-ui/core/Dialog';
import MuiDialogTitle from '@material-ui/core/DialogTitle';
import MuiDialogContent from '@material-ui/core/DialogContent';
import MuiDialogActions from '@material-ui/core/DialogActions';
import IconButton from '@material-ui/core/IconButton';
import CancelIcon from './Cancelbutton .png';
import Typography from '@material-ui/core/Typography';
import stylescss from "./CallWidget.css";


const styles = (theme) => ({
  root: {
    // margin: 0,
    // width:'550px',
    // boxShadow: '0 4px 8px 0 rgba(0,0,0,0.2)',
    // transition: '0.3s',
    // width: '20%',
    // borderRadius: '5px',
    // position: 'absolute',

    // backgroundColor: 'black'
    // padding: theme.spacing(2),
  },
  closeButton: {
    // position: 'absolute',
    // height:'0.1vh',
    // width:'0.1vh',
    // right: theme.spacing(1),
    // top: theme.spacing(1),
    // color: theme.palette.grey[500],
  },
  dialogTitle:{
    backgroundColor:'#000000',
    width:'200px',
    textAlign : 'center',
  },
  dialog:{
    color:'white',
    fontWeight:'bold',
  },
  // CancelIcon : {
  //   height:'10px',
  //   width:'10px',
  // }
});

const DialogTitle = withStyles(styles)((props) => {
  const { children, classes, onClose, ...other } = props;
  return (
    <MuiDialogTitle  className={classes.dialogTitle} >
      <Typography className={classes.dialog} variant="h6">{children}</Typography>
      {/* {onClose ? (
        <IconButton aria-label="close"  onClick={onClose}>
          <img src={CancelIcon} className={classes.closeButton} alt="cancel button"/>
        </IconButton>
      ) : null} */}
    </MuiDialogTitle>
  );
});

const DialogContent = withStyles((theme) => ({
  root: {
    textAlign:'center',
  },
}))(MuiDialogContent);

// const DialogActions = withStyles((theme) => ({
//   root: {
//     margin: 0,
//     padding: theme.spacing(1),
//   },
//   closeIcon:{
//     height:'10px',

//   }
// }))(MuiDialogActions);

const DialogActions = withStyles(styles)((props) => {
  const { children, classes, onClose, ...other } = props;
  return (
    <MuiDialogActions  className={classes.dialogActions} >
      {/* <Typography className={classes.dialog} variant="h6">{children}</Typography> */}
      {onClose ? (
        <IconButton aria-label="close" className={classes.CancelIcon} onClick={onClose}>
          <img src={CancelIcon} className={classes.closeButton} alt="cancel button"/>
          {/* {children} */}
        </IconButton>
      ) : null}
    </MuiDialogActions>
  );
});

export default function CustomizedDialogs() {
  const [open, setOpen] = React.useState(false);
  const [nasaData,  setData] = React.useState({ });

  async function fetchData() {
    const res = await fetch("https://codifyinditest.com/script_test/api-test/")
    const data = await res.json()
    setData(data)
  }

  useEffect(() => {
    fetchData()
  }, [])

  const handleClickOpen = () => {
    setOpen(true);
    console.log('clicked true');
  };
  const handleClose = () => {
    console.log('clicked true');
    setOpen(false);
  };

  const { labels, phone_number } = nasaData['script test'] || {};

  const onValue = nasaData['script test'];
  console.log('apple', onValue);



  return (
    <div>
      <Button variant="outlined" color="primary" onClick={handleClickOpen}>
        Call Us Now
      </Button>
      <Dialog onClose={handleClose} aria-labelledby="customized-dialog-title" open={open}>
        <DialogTitle id="customized-dialog-title" onClose={handleClose}>
          {labels}
        </DialogTitle>
        <DialogContent dividers>
          <Typography gutterBottom>
            {phone_number}
          </Typography>
        </DialogContent>
        <DialogActions>
          <Button autoFocus onClick={handleClose} color="primary">
            {/* Cancel */}
            {/* <div className={stylescss.closeIcon}> */}
            {/* <img src={CancelIcon} alt="cancel button"/> */}
            {/* </div> */}
            {CancelIcon}
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}
